import React from "react";
import { Switch, Routes } from "react-router-dom";
import About from "./About";
import Contact from "./Contact";
const App = () => {
  return (
    <Switch>
      <Routes path="/" Component={About} />
      <Routes path="/contact" Component={Contact} />
    </Switch>
  );
};

export default App;
